import "./App.css";
import { useState, useRef } from "react";

function App() {
  let inpValue = useRef();

  function logName() {
    console.log(inpValue);
  }

  return (
    <div className="App">
      <input ref={inpValue} type="text" />
      <button onClick={logName}>Log name</button>
    </div>
  );
}

export default App;
